// src/App.jsx
import React, { useEffect } from 'react';
import AOS from 'aos';
import Home from './pages/Home';

// Importar main.css aqui (depois que as vari치veis j치 foram carregadas)
import './styles/main.css';

function App() {
  useEffect(() => {
    AOS.init({
      duration: 600,
      easing: 'ease-in-out',
      once: true,
      mirror: false
    });
  }, []);

  return (
    <div className="App">
      <Home />
    </div>
  );
}

export default App;
